function onlyNumbers(string) {
  if (string == undefined) {
    return 0;
  }

  return string.replace(/\D/g, '');
}

function removeMoneyCurrency(string) {
  if (string.charAt(0) == '-') {
    return '-' + string.substring(4);
  }

  return string.substring(3);
}
